    @beginTime),
    '%H:%i:%s'),
    'counts',
    @countSpecimens,
    'testNumber',
    @testNumber,
    'testName',
    se.testName,
    'endCap',
    se.endCap,
    'fail',
    se.failText,
    'remark',
    se.remark) INTO @result
  FROM specimen se
  WHERE se.id = idSpecimen;

  RETURN @result;
END
$$

