--
-- Create procedure `selectTestData`
--
CREATE
DEFINER = 'root'@'%'
PROCEDURE selectTestData (IN idSpecimen int UNSIGNED)
DETERMINISTIC
BEGIN

  SET @initTime = (SELECT
      td.createdAt
    FROM data td
    WHERE td.specimen = idSpecimen
    ORDER BY td.createdAt ASC LIMIT 1);

  WITH groupingData
  AS
  (SELECT
