DELIMITER $$

--
-- Create trigger `DeleteTestSample`
--
CREATE
DEFINER = 'root'@'%'
TRIGGER DeleteTestSample
AFTER DELETE
ON specimen
FOR EACH ROW
BEGIN

  SET @countTests = 0;

  SELECT
    COUNT(*) INTO @countTests
  FROM specimen ts
  WHERE ts.sample = OLD.sample;

  IF @countTests < 1 THEN

    DELETE LOW_PRIORITY QUICK
      FROM sample
    WHERE sample.id = OLD.sample;

  END IF;

END
$$

--
-- Create trigger `DeleteTest`
--
CREATE
DEFINER = 'root'@'%'
TRIGGER DeleteTest
BEFORE DELETE
ON specimen
FOR EACH ROW
BEGIN

  DELETE LOW_PRIORITY QUICK
    FROM data td
  WHERE td.test_specimen = OLD.id;

END
$$

DELIMITER ;

